import React from "react";
import Container from "@material-ui/core/container";
import Timeline from "../comps/timeline";

class index extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            events: [
                {
                    title: "網路班會",
                    cal: "待辦事項",
                    startTime: "10:00",
                    endTime: "11:00"
                },
                {
                    title: "學習 React",
                    cal: "開發設計",
                    startTime: "11:15",
                    endTime: "11:45"
                },
                {
                    title: "安裝 Ubuntu 作業系統",
                    cal: "開發設計",
                    startTime: "12:00",
                    endTime: "12:30"
                },
                {
                    title: "建置桃園 V2ray 伺服器",
                    cal: "開發設計",
                    startTime: "14:00",
                    endTime: "14:45"
                },
                {
                    title: "和家人吃午餐",
                    cal: "重要事項",
                    startTime: "15:00",
                    endTime: "16:45"
                },
                {
                    title: "去星巴克找朋友",
                    cal: "提醒事項",
                    startTime: "17:00",
                    endTime: "18:15"
                },
                {
                    title: "建置桃園 V2ray 伺服器",
                    cal: "開發設計",
                    startTime: "19:00",
                    endTime: "20:00"
                }
            ]
        };
    }

    render() {
        const style = {
            marginTop: 60
        };

        return (
            <Container maxWidth="sm" style={style}>
                <Timeline />

                <style global jsx>{`
                    body {
                        background: black;
                    }
                `}</style>
            </Container>
        );
    }
}

export default index;
